import Posts from './components/Posts';
import { BrowserRouter, Routes, Route  } from "react-router-dom";




const App = (props) => {
  return (
  <BrowserRouter>
    <Routes>
    <Route path='/picture' element={<Picture/>} />
      <Route path="/about" element={<About/>} />
      <Route path="/posts" element={<Posts/>} />

    </Routes>
  </BrowserRouter>
